import { BrowserRouter, Routes, Route } from "react-router-dom";
import { Box } from "@mui/system";

const App = () => (
  <BrowserRouter>
    <Box sx={{ backgroundColor: "#000" }}>
      Navbar
      <Routes>
          <Route path="/" exact element={<Feed/>}/>
          <Route path="/vid" exact element={<Feed/>}/>

      </Routes>
    </Box>
  </BrowserRouter>
);

export default App;
